import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Babatest from './component/Babatest'



import * as serviceWorker from './serviceWorker';



class StatefullComponent extends React.Component{
    render(){
        return <p>ini statefull kompoen</p>
    }
}

ReactDOM.render( <Babatest/>, document.getElementById('root'));

